import React from 'react';
import './prestations.css';
import Card from '../Prestations/card/card';

function Prestations() {
  const cardsData = [
    {
      title: "Produit 1",
      imageUrl: "url_de_l_image_1.jpg",
      detailLink: "/produit1",
      price: "$99.99",
    },
    {
      title: "Produit 2",
      imageUrl: "url_de_l_image_2.jpg",
      detailLink: "/produit2",
      price: "$79.99",
    },
    // Ajoutez plus de données de carte ici
  ];

  const product1 = cardsData[0];

  return (
    <div>
      <div className='mt-16 text-center text-5xl sm:text-7xl font-signikaSemiBold'>Mes prestations</div>
      <div className="sm:flex sm:flex-row sm:mt-40 sm:ml-28 text-center mt-36 space-y-4 md:space-y-4 sm:space-y-0">
        <div className="w-full sm:w-1/2 flex flex-col">
          <Card {...product1} /> 
        </div>
        <div className="w-full sm:w-1/2 flex flex-col">02</div>
        <div className="w-full sm:w-1/2 flex flex-col">03</div>
        <div className="w-full sm:w-1/2 flex flex-col">04</div>
        <div className="w-full sm:w-1/2 flex flex-col">05</div>
      </div>
    </div>
  );
}

export default Prestations;
